import React from 'react';

function Recipe({title, description, time, price, amount}) {
    return (
        <div>
            <h1>Title {title}</h1>
            <h3>Description: {description}</h3>
            <h4>Time {time}</h4>
            <h4>Amount: {amount}</h4>
            <h4>Price: {price}</h4>
            <ul>
                <li>Ingridient</li>
            </ul>
        </div>
    );
}

export default Recipe;
